import react from 'react';
import './style.scss'
import Button from '../../container/button'

const FlexButton = ({gameBegining, playerPV, monsterPv}:any) => {
  return (
    <div className="flexButton">
     {!gameBegining && <Button buttonName='begin' buttonClassName='flexButton'  />}
     {(gameBegining && playerPV != 0 && monsterPv != 0) && <Button buttonName='attack' buttonClassName='flexButton'  />}
     {(gameBegining && playerPV != 0 && monsterPv != 0) && <Button buttonName='specialAttack' buttonClassName='flexButton'  />}
     {(gameBegining && playerPV != 0 && monsterPv != 0) && <Button buttonName='heal' buttonClassName='flexButton'  />}
     {(gameBegining && playerPV != 0 && monsterPv != 0) && <Button buttonName='giveUp' buttonClassName='flexButton'  />}
    </div>
  )
}
export default FlexButton
